/* swatches_and_quickview */
var _custom_loader = $('.custom-loader');
var modal_qv_parent = $('#ModalquickView');
var modal_qv_open = false;
var modal_qv_content = modal_qv_parent.find('.modal-content');
if(modal_qv_parent.length) {
  modal_qv_parent.on('show.bs.modal', function(e) {
    /* modal */
    modal_qv_open = true;
    _custom_loader.show();
    modal_qv_content.hide();//hide content
    var relatedTarget = $(e.relatedTarget).filter(':first');

    global_quantity = {};
    var qa = relatedTarget.attr('data-quantity').split(';');
    if(qa.length > 0){
      for(var i = 0; i < qa.length; i++){
        if(qa[i] === '') break;
        var _qa = qa[i].split('-');
        global_quantity[_qa[0]] = _qa[1];
      }
    }

    var attr = relatedTarget.attr('data-value');
    var optionimages = relatedTarget.attr('data-optionimages');
    
    var small_description = relatedTarget.closest('.product-parent').find('.description').html();
    var fn = window['configureQuickView'];
    typeof(fn) === "function" && fn(attr, small_description, optionimages);
  }).on('hidden.bs.modal', function () {
    modal_qv_open = false;
    var fn = window['destroyQuickView'];
    typeof(fn) === "function" && fn();
  });
}

var quick_view_loader = {
  btn: false,
  wait: function(_btn){
    if(!modal_qv_open) return false;
    this.btn = _btn;
    _btn.html(wait_text);
  },
  error: function(){
  	if(!modal_qv_open) return false;
    this.btn.addClass('quickview-error').html(errorhtml_text);
    this.default_text('quickview-error');
  },
  added: function(){
    if(!modal_qv_open) return false;
    this.btn.addClass('quickview-added').html(addedhtml_text);
    this.default_text('quickview-added');
  },
  default_text: function(value){
    setTimeout(function(){quick_view_loader.btn.removeClass(value).html(addtocart_text)}, 1000);
  }
}

var quickview_swatches = false;
function configureQuickView(product_url, small_description, optionimages){
  var handle = product_url.split('/').pop();
  Shopify.getProduct(handle, qvLoadSuccess);

  /* hide preloader when ajax error */
  function qvLoadSuccess(json_data){
    var swatchesdesign1 = $('.tt-quickview-swatches-container-js').length && $('.tt-quickview-swatches-container-js').data('swatches-design1');
    var swatchesdesign2 = $('.tt-quickview-swatches-container-js').length && $('.tt-quickview-swatches-container-js').data('swatches-design2');
    var swatchesdesign3 = $('.tt-quickview-swatches-container-js').length && $('.tt-quickview-swatches-container-js').data('swatches-design3');
    var cur_opt = optionimages != null ? JSON.parse(optionimages) : '';
    var full_opt = cur_opt != '' ? $.extend( texture_obj, cur_opt ) : texture_obj;
    var product_handle = json_data.handle;
    var show_unavailable_options = $('.show_unavailable_variants').length > 0;

    quickview_swatches = new SwatchesConstructor(json_data, {contentParent: '.tt-quickview-swatches-container-js', enableHistoryState: false, callback: quickViewVariant, externalImagesObject: full_opt, externalColors: colors_value, colorWithBorder: color_with_border, productHandle:product_handle, designOption1:swatchesdesign1, designOption2:swatchesdesign2, designOption3:swatchesdesign3, show_unavailable_options: show_unavailable_options });
    json_data = null;
    /* modal */
    _custom_loader.hide();
    modal_qv_content.fadeIn();//show content
  }
  function quickViewVariant(variant, product){
    var _ = modal_qv_parent;
    var _parent_general_info = _.find('.tt-product-single-info');
    var _swatch = _.find('.tt-quickview-swatches-container-js');
    swatchVariantHandler(_parent_general_info, variant);
    swatchVariantButtonHandler(_parent_general_info, variant);
    addToCartHandler.initFormAddToCartButton(variant.id, _parent_general_info, _swatch);
    
    _.find('.input_variant').attr('value', variant.id);
    _.find('.tt-title').html(product.title);
    _.find('.viewfullinfo') && _.find('.viewfullinfo').attr('href', product_url);

    _.find('.qv_vendor') && _.find('.qv_vendor').html(product.vendor);
    var qv_type = _.find('.qv_type');
    if(qv_type.length){
      product.type == '' ? qv_type.parent().hide() : qv_type.html(product.type).parent().show();
    }
    
    var _img = _.find('.product-main-image');
    var img_src = variant.featured_image ? variant.featured_image.src : product.featured_image;
    if(_img.children().length) _img.children().first().attr('src', img_src)
    else $('<img src="'+img_src+'" alt="Quick View Image">').appendTo(_img);
    
    var description = _.find('.description').empty();
    description.length && description.html(small_description);

    if($(".spr-badge").length > 0 && _.find('.rating').children().length == 0) {
      _.find('.rating').append("<span class=\"shopify-product-reviews-badge\" data-id=\""+product.id+"\"></span>");
      $.getScript(window.location.protocol + "//productreviews.shopifycdn.com/assets/v4/spr.js");
    }
  }
}
function destroyQuickView(){
  quickview_swatches && quickview_swatches.destroy();
  quickview_swatches = false;
  var _ = modal_qv_parent;
  _.find('.product-main-image').empty();
  _.find('.description').empty();
  _.find('.swatches-container').empty();  
  _.find('.title').empty();
  _.find('.rating').empty();  
}


function swatchVariantHandler(_parent, variant) {
  var _ = _parent;
  var _price = _.find('.tt-price');
  var _info = _.find('.tt-add-info');
  var _sku = _info.length && _info.find('.sku-js');
  var _avaibility = _info.length && _info.find('.availability');
  var _input = _.find('.tt-input-counter').find('input');
  
  var _barcode = _.find('.barcode');

  var price_str = Shopify.formatMoney(variant.price, money_format);
  var price_comare_str = Shopify.formatMoney(variant.compare_at_price, money_format);
  if(variant.price < variant.compare_at_price){
    _price.find('>span:first').addClass('sale-price').html(price_str);
    _price.find('>span:last').removeClass('hide').html(price_comare_str);
  }
  else {
    _price.find('>span:first').removeClass('sale-price').html(price_str);
    _price.find('>span:last').addClass('hide');
  }
  
  if(_sku.length) {
    _sku.each(function(){
      $(this).children().last().html(variant.sku);
    })
    variant.sku == '' ? _sku.addClass('hide') : _sku.removeClass('hide');
  }
  
  if(_barcode.length) {
    _barcode.html(variant.barcode);
    variant.barcode === null || variant.barcode == '' ? _barcode.parent().addClass('hide') : _barcode.parent().removeClass('hide');
  }
  
  // Inventory Quantity
  var inventory_management = variant.inventory_management;
  var inventory_quantity = global_quantity[variant.id];//variant.inventory_quantity;

  if(_avaibility.length){
    if(Boolean(variant.available) && inventory_quantity != "continue"){
      _avaibility.find('.sold_out').addClass('hide');
      if(inventory_management == null){
        inventory_quantity = 9999;
        _avaibility.find('.stock_quantity, .in_stock, .continue_out').addClass('hide');
        _avaibility.find('.many_in_stock').removeClass('hide');
      }
      else {
        _avaibility.find('.stock_quantity').removeClass('hide').html(inventory_quantity);
        _avaibility.find('.in_stock').removeClass('hide');
        _avaibility.find('.many_in_stock, .continue_out').addClass('hide');
      }
      _input.val(1).attr('size', inventory_quantity);
    }
    else {
      if(inventory_quantity == "continue"){
        inventory_quantity = 9999;
        _avaibility.find('.stock_quantity, .in_stock, .many_in_stock').addClass('hide');
        _avaibility.find('.continue_out').removeClass('hide');
      }
      else{
        _avaibility.find('.stock_quantity, .in_stock, .many_in_stock').addClass('hide');
        _avaibility.find('.sold_out').removeClass('hide');
      }
    }
  }
  
  
  
  $('body').trigger('refreshCurrency');
}

// 03/16/20 -- show a 'notify me when back-in-stock' form when a variant is sold out
function swatchVariantButtonHandler(_parent, variant) {
  var regex = /\[(.*?)\]/g;
  var _btnaddtocart = _parent.find('.btn-addtocart');
  var atcContainer = document.querySelector('.atc-form__container');
  var backInStockForm = document.querySelector('#BIS_trigger');

  if(_btnaddtocart.length == 0) return false
  // Form
  if(Boolean(variant.available)) {
    atcContainer.classList.remove('matty-hide');
    backInStockForm.classList.add('matty-hide');
  }
  else {
    backInStockForm.classList.remove('matty-hide');
    atcContainer.classList.add('matty-hide');
    backInStockForm.setAttribute('data-variant-id', variant.id)
    
  }
}


/* cart api */
var addToCartHandler = {
  initItemAddToCartButton: function(){
    var _btns = $('.addtocart-item-js');
    $('body').on('click', '.addtocart-item-js', function(e){
      e.preventDefault();
      var variant_id = $(this).closest('form').find('input').val();
      Shopify.addItem(variant_id, 1);
    })
  },
  initFormAddToCartButton: function(variant_id, _parent, _swatch){
    var _btn = _parent.find('.addtocart-js');
    if(_btn.length == 0) return false;

    _btn.unbind().click(function(e){
      e.preventDefault();

      var form_id = _btn.closest("form").attr("id");
      Shopify.addItemFromForm(form_id)

      typeof quick_view_loader !== 'undefined' && quick_view_loader.wait(_btn);
    })
  },
  addItem: function(line_item) {
    relatedCartProducts.handle = line_item.handle;
    
    var _parent = $('header').find('.tt-cart');
    var _empty_cart = $('.tt-cart-empty');
    var _ul = _parent.find('.tt-cart-list');

    var price_str = getItemFormatedPrice(line_item.price);
    var _ = $('.item-html-js').children().clone();
    _.find('.tt-title').html(line_item.product_title);
    _.find('.tt-price').html(price_str);
    _.find('.qty').html(line_item.quantity);
    _.find('>a:first-child').attr('href', line_item.url);

    var _img = _.find('.tt-item-img').empty();
    $('<img src='+line_item.image+' alt="Cart Image">').appendTo(_img);
    
    var _details = _.find('.details');
    line_item.variant_title == null ? _details.parent().remove() : _details.html(line_item.variant_title.replace(/ \//g, ', '));

    var delete_btn = _.find('.header_delete_cartitem_js');
    var delete_url = String(delete_btn.attr('href')).replace('id=0', 'id='+line_item.id);
    delete_btn.attr('href', delete_url);
    
    _ul.find('[href="'+delete_url+'"]').length && _ul.find('[href="'+delete_url+'"]').closest('.tt-item').remove();
    $(_).prependTo(_ul);
    !_empty_cart.hasClass('hide') && _empty_cart.addClass('hide');
    
    var tt_cb = _parent.find('.tt-cart-box');
    tt_cb.hasClass('hide') && tt_cb.removeClass('hide');
    
    var _ul_children = _ul.children();
    _ul_children.length && _ul_children.hide();
    _ul_children.each(function(index){
      if(index >= 3) return false;
      $(this).show();
    });
    _ul_children.length > 3 && $('.header-cart-more-message-js').show();
  },
  updateGeneralInfo: function(cart){
    var price_str = getItemFormatedPrice(cart.total_price);
    var _parent = $('header').find('.tt-cart');
    _parent.find('.tt-badge-cart').text(cart.item_count);
    cart.item_count == 0 ? _parent.find('.tt-badge-cart').addClass('hide') : _parent.find('.tt-badge-cart').removeClass('hide');
    _parent.find('.tt-cart-total-price').empty().html(price_str);
  }
}

var addedModal = {
  $modal: $('#modalAddToCartProduct'),
  initSingleItem: function(line_item){
    relatedCartProducts.handle = line_item.handle;

    var price_str = getItemFormatedPrice(line_item.price*line_item.quantity);
    var _ = this.$modal;
    _.find('.tt-title-js').html(line_item.product_title);
    var _details = _.find('.description');
    
    var str = '';
    for(var i=0; i<3; i++){
      var opt = line_item.variant_options[i];
      if(opt != null) str += opt + ', ';
    }
	str = str.substring(0, str.length-2);
    
    line_item.variant_title == null ? _details.hide() : _details.show().html(str);
    _.find('.tt-qty span').first().empty().text(line_item.quantity);
    _.find('.total-product-js .tt-price').first().empty().html(price_str);

    var _img = _.find('.tt-img').empty();
    line_item.image !== null && $('<img src="'+line_item.image+'" alt="Added Product">').appendTo(_img);
  },
  initGeneralInfo: function(cart){
    var price_str = getItemFormatedPrice(cart.total_price);
    var _ = this.$modal;
    _.find('.modal-total-quantity').text(cart.item_count);
    _.find('.full-total-js').html(price_str);
  },
  showModal: function(){
    if(typeof modal_qv_open !== 'undefined') {
      if(modal_qv_open) return false;
    }

    var $this = this.$modal;
    
    $this.modal('show');
    
    var _ = this.$modal;
    _.find('.close-modal-added-js').click(function(e){
      e.preventDefault();
      $(this).unbind();
      $this.modal('hide');
    })

    $this.on('shown.bs.modal', function(){
      $(this).unbind('shown.bs.modal');
      relatedCartProducts.init();
    });
    $this.on('hidden.bs.modal', function(){
      $(this).unbind('hidden.bs.modal');
      relatedCartProducts.destroy();
    });
  }
}
var relatedCartProducts = {
  handle: false,
  init: function(){
    if(!$('.tt-modal-slider-js').length || !$('.tt-modal-slider').length || !related_collection_item) return false;
    
    $.ajax({
      type: "GET",
      url: '/collections/'+related_collection_item+'?view=ajax_related',
      success: function(data) {
        if(data == '') return false;
        $('.tt-modal-slider').removeClass('hide');
        $('.tt-modal-slider-js').append(data);
        $('.tt-modal-slider-js').find('.'+relatedCartProducts.handle).remove();
        relatedCartProducts.initSlider();
        data = null;
      },
      error: function(XMLHttpRequest, textStatus) {
      },
      dataType: "html"
    })
  },
  initSlider: function(){
    $('.tt-modal-slider-js').slick({
      dots: false,
      arrows: true,
      infinite: true,
      speed: 300,
      slidesToShow: 5,
      slidesToScroll: 1,
      adaptiveHeight: false,
      responsive: [
        {
          breakpoint: 1025,
          settings: {
            slidesToShow: 3,
          }
        },
        {
          breakpoint: 575,
          settings: {
            slidesToShow: 1
          }
        }
      ]
    });
  },
  destroy: function(){
    if(!$('.tt-modal-slider-js').length || !$('.tt-modal-slider').length || !related_collection_item) return false;
    $('.tt-modal-slider-js').slick('unslick').empty();
    $('.tt-modal-slider').addClass('hide');
    relatedCartProducts.handle = false;
    related_collection_item = false;
  }
}
var related_collection_item = false;
$('body').on('click', '.addtocart-item-js, .addtocart-js', function(e){
  var attr = $(this).attr('data-relatedcollection');
  if (typeof attr !== typeof undefined && attr !== false) {
    related_collection_item = attr;
  }
})

function getItemFormatedPrice(value){
  return Shopify.formatMoney(value, money_format);
}

/* override functions api.jquery.js */
Shopify.onItemAdded = function(line_item) {
  Shopify.getCart();
  addToCartHandler.addItem(line_item);
  addedModal.initSingleItem(line_item);
};

Shopify.onCartUpdate = function(cart) {
  addToCartHandler.updateGeneralInfo(cart);
  addedModal.initGeneralInfo(cart);
  addedModal.showModal();
  typeof quick_view_loader !== 'undefined' && quick_view_loader.added();
  $('body').trigger('refreshCurrency');
};
Shopify.onError = function(XMLHttpRequest, textStatus) {
  if(typeof modal_qv_open !== 'undefined') {
    if(modal_qv_open) {
      quick_view_loader.error();
      return false;
    }
  }

  var data = eval('(' + XMLHttpRequest.responseText + ')');
  if (!!data.message) {
    var str = data.description;
  } else {
   	var str = 'Error : ' + Shopify.fullMessagesFromErrors(data).join('; ') + '.';
  }
  $('#modalAddToCartError .error_message').text(str);
  $('#modalAddToCartError').modal("toggle");
}

var removeFromCartHandler = function(){
  $('body').on('click', '.header_delete_cartitem_js', function(e){
    e.preventDefault();
    $(this).closest('.tt-item').addClass('removeAfterCompleteAjax');
    var variant_id = getIdFromUrl($(this).attr("href"));
    Shopify.removeItem(variant_id, onCartUpdateCustom);
  });
}
function onCartUpdateCustom(cart){
  if(cart.item_count == 0){
    $('.tt-cart-empty').removeClass('hide');
    $('.tt-cart-box').addClass('hide');
  }
  
  _ul_children = $('header').find('.tt-cart').find('.tt-cart-list').children();
  
  _ul_children.each(function(index){
    if(index == 4) return false;
    $(this).show();
  });

  _ul_children.length <= 4 && $('.header-cart-more-message-js').hide();

  $('.removeAfterCompleteAjax').remove();
  addToCartHandler.updateGeneralInfo(cart);
  $('body').trigger('refreshCurrency');
}
function getIdFromUrl(url){
  url = url.match(/id=\d+/g);
  return url[0].match(/\d+/g);
}
addToCartHandler.initItemAddToCartButton();
removeFromCartHandler();